import sqlite3
conn=sqlite3.connect("ultraman.db")
conn.execute("""
CREATE TABLE IF NOT EXISTS ultraman (
id INTEGER PRIMARY KEY NOT NULL ,
name TEXT NOT NULL, 
main_img TEXT
)
""")
conn.execute("""
INSERT INTO ultraman (id,name,main_img) \
VALUES (1,'marin', '')
""");
conn.commit()

data = conn.execute("""
SELECT * FROM ultraman WHERE id = 1
""").fetchone()
print(data[1])